import React from "react";

function AIDoctor() {
  return (
    <div className="chat-view w-full h-screen mt-10 flex justify-center items-center">
      <div className="chat-body w-full h-full m-10 flex justify-center items-center rounded-3xl shadow-animate relative">
        <div className="chat w-full h-full flex bg-[#202024] text-white rounded-3xl m-10 z-10">
          <div className="w-96 my-10 ml-10 rounded-3xl border-[#a0128d] border shadow-sm "></div>
          <div className="w-full flex-1  m-10 rounded-3xl">
            <div className="chat-view flex w-full h-full rounded-3xl bg-black">
              <div className="chat-input flex w-full h-10 rounded-b-3xl bg-white border-[#a0128d] border-t-0 border-b-0"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AIDoctor;
